import { Route, Routes, BrowserRouter } from "react-router-dom";
import './App.css';
import Hangar from "./pages/hangar/Hangar";
import News from "./pages/news/News";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Hangar />}/>
        <Route path="/news" element={<News />}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
